import React from "react"
import Navbar from "./components/Navbar.js";
import './App.css'

export default function App() {
    return(
        <div>
            <Navbar />
            <div className="Sun">
                <div className="Earth"></div>
                <div className="Moon"></div>
            </div>
        </div>
    )
}
